import React, { children } from 'react';   
import { Menu,  Input } from 'antd'; 
 

const AppLayout = () =>{



    return (
        <div>
            <Menu>
                <Menu.Item key="home">Gallery</Menu.Item>
                <Menu.Item key="profile">my</Menu.Item>
                <Menu.Item key="search">
                    <Input.Search enterButton />
                </Menu.Item>
            </Menu>
            {children}
        </div>
      );
}


export default AppLayout.js
